TEST = 'dabAcCaCBAcCcaDA'
DATA = ''


def _remove_units(s, u):
    return ''.join(c for c in s if c.lower() != u)


def _units(s):
    return {c.lower() for c in s}


def _eliminate(stack):
    while len(stack) > 1:
        a = stack.pop()
        b = stack.pop()
        should_eliminate = (a != b and a.lower() == b.lower())
        if not should_eliminate:
            stack.append(b)
            stack.append(a)
            return


def reduce(s):
    lst = []
    for i in range(len(s)):
        lst.append(s[i])
        _eliminate(lst)
    s_reduced = ''.join(lst)
    return s_reduced


def solve(s):
    us = _units(s)
    min_len = None
    for u in us:
        s_removed = _remove_units(s, u)
        s_reduced = reduce(s_removed)
        len_reduced = len(s_reduced)
        if min_len is None or len_reduced < min_len:
            min_len = len_reduced
    return min_len


if __name__ == '__main__':
    assert 4 == solve(TEST)
    print(solve(DATA))
